import React, { useState, useEffect } from 'react';
import { Link, useParams } from 'react-router-dom';
import axios from 'axios';
import Header from '../components/Header';
import './MyPost.css';
import '../components/Sidebar.css';

function MyPost() {
  const { user_id } = useParams();
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    const fetchPosts = async () => {
      try {
        const response = await axios.get('/myposts.json');
        setPosts(response.data);
      } catch (error) {
        console.error('Failed to fetch posts:', error);
      }
    };

    fetchPosts();
  }, [user_id]);

  return (
    <div className="MyPost">
      <Header />
      <div className="MyPost-container">
        <div className="Sidebar">
          <div className="Profile-picture">
            <img src="/path/to/default-profile.png" alt="프로필 사진" />
          </div>
          <h2>윤영선</h2>
          <Link to={`/profile/edit/${user_id}`}>프로필 수정</Link>
          <Link to={`/scrap/${user_id}`}>스크랩</Link>
          <Link to={`/myposts/${user_id}`} className="active">내가 쓴 글</Link>
          <Link to={`/reservations/${user_id}`}>소속 동아리</Link>
        </div>
        <div className="Content">
          <h2>내가 쓴 글</h2>
          <div className="Posts-list">
            {posts.map((post) => (
              <div key={post.id} className="Post-item">
                <div className="Post-header">
                  <div className="Post-header-left">
                    <img src="/path/to/default-profile.png" alt="프로필 사진" />
                    <div className="Post-header-info">
                      <span>{post.author}</span>
                      <span>{post.category}</span>
                    </div>
                  </div>
                  <button className="Delete-button" onClick={() => console.log('삭제 기능 구현 필요')}>삭제</button>
                </div>
                <div className="Post-body">
                  <h3>{post.title}</h3>
                  <p>{post.content}</p>
                </div>
                <div className="Post-footer">
                  <span>좋아요 {post.likes}</span>
                  <span>댓글 {post.comments}</span>
                  <span>작성날짜 {post.date}</span>
                </div>
              </div>
            ))}
          </div>
          <div className="Pagination">
            <span>1</span>
            <span>2</span>
            <span>3</span>
            <span>4</span>
            <span>5</span>
            <span>6</span>
            <span>7</span>
            <span>8</span>
            <span>9</span>
            <span>10</span>
          </div>
        </div>
      </div>
    </div>
  );
}

export default MyPost;
